import { useState } from "react";
import { Link } from "react-router-dom";


// function onClickSubmit(e) {
//       e.preventDefault();
//       console.log('You clicked submit.'); 
// }

const loader = document.getElementById('loader');
removeLoader = () => {
    display : 'none'
}

setTimeout(removeLoader, 3000);

const LoginForm =()=>{
    const [email, setEmail]= useState('');
    const [password, setPassword]= useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        console.log("submit works");
      }


    return (
        <div className="loginPage">
            <div id="loader" className='loader' onChange={removeLoader()}>
                <img src="/image/logo.svg" alt="Money Cat logo" className="logo"/>
                <p>Money Cat</p> 
            </div>

            <div className="round"></div>
            <img src="/image/loginCat.png" alt="Japanese torii cat" className="loginCat" width="1200"
            height="1200"/>

        <h1 className="loginH1">Login</h1>
        <p>Welcome Back!</p>

        <form onSubmit={handleSubmit}>

            <input 
            type="email" 
            id="email" 
            className="email" 
            name="email"
            aria-label="Email" placeholder="Email" 
            required 
            value={email}
            onChange={(e)=> setEmail(e.target.value)}
            />

            <input 
            type="text" 
            id="password" 
            className="password" 
            name="password"
            aria-label="Password" placeholder="Password" 
            required 
            value={password}
            onChange={(e)=> setPassword(e.target.value)}
            />

            <input type="submit" value="Login"/>
        </form>

        <p>Donâ€™t have an account? 
            <Link to="/start">Sign up</Link>
        </p>
      </div>
    );
  }

  export default LoginForm;
